  ('10', '兰博基尼Huracan高清大图壁纸欣赏下载', '兰博基尼Huracan,高清图片壁纸,高清下载', '兰博基尼Huracan系列,此图集专门为Huracan开设,精心收集各色兰博基尼Huracan,各种角度,各种姿势.喜欢的图,在旅图!', '<p>	<a href="https://baike.baidu.com/item/%E5%85%B0%E5%8D%9A%E5%9F%BA%E5%B0%BCHuracan/12982371?fr=aladdin"><strong>百度百科</strong></a></p>

<p>	<em>兰博基尼Huracan”是兰博基尼的一种型号。2013年底，</em><a href="https://baike.baidu.com/item/%E5%85%B0%E5%8D%9A%E5%9F%BA%E5%B0%BC"><em>兰博基尼</em></a><em>官方正式公布了全新车型Huracan LP610-4车型的官方指导价，其售价为429.088万元人民币。</em></p>

<p>	<em>Huracan的名字在西班牙语中直译为“飓风”，外观方面，Huracan的设计与此前发布的Sesto Elemento概念车相同具有很强的相似性，设计上也秉承了兰博基尼一贯的攻击性，特别是其尾部还启用了全LED尾灯。据悉，经过轻量化的设计，这款新车将会采用碳纤维材质来进一步降低车身重量。</em></p>

